import { LOADING, SUCCESS_MSG, SET_LINK_CODE, SET_USER } from "./constants";

export const setLoading = (state) => ({
  type: LOADING,
  payload: state,
});

export const setUser = (payload) => ({
  type: SET_USER,
  payload: payload,
});
